import React from 'react';
import Popup from 'reactjs-popup';
import 'reactjs-popup/dist/index.css';

const divStyle = {
    color: '#082459',
    fontSize: '24px',
    fontFamily: 'Roboto',
    fontWeight: 700,
    wordWrap: 'break-word',
    display: 'flex'
  };
 
export default function Inputfood() {
    return (
        <div>
            <Popup trigger=
                {<button> กรอก </button>} 
                modal nested>
                {
                    close => (
                        <div className='modal'>
                            <div style={divStyle}>
                                กรอกอาหาร
                            </div>
                            <div>
                                <button onClick=
                                    {() => close()}>
                                        Close modal
                                </button>
                            </div>
                        </div>
                    )
                }
            </Popup>
        </div>
    )
};
